import React from 'react'
import {useNavigate} from 'react-router-dom'

export default function Nav() {
    const navigate = useNavigate();
  return (
    <div className='flex w-full h-32 bg-slate-900 items-center justify-center  '>
      <p onClick={() => navigate( '/')} >Gainer Form</p>
      <p onClick={'/assesories'}>Assessories Form</p>
      <p onClick={'/machine'}>machines Form</p>
    </div>
  )
}
